import React from "react";
import {
  Card,
  CardBody,
  Col,
  Container,
  Row
} from "reactstrap";
import BootstrapTable from "react-bootstrap-table-next";
import paginationFactory from "react-bootstrap-table2-paginator";
import { connect } from "react-redux";
import { selectUsers } from "../../redux/selectors/UserSelector";
import {getListUserAction} from "../../redux/actions/UserActions";
import UserApi from "../../api/UserApi";

const tableData = [
  ];

const tableColumns = [
  {
    dataField: "username",
    text: "User name",
    sort: true
  },
  {
    dataField: "email",
    text: "Email",
    sort: true
  },
  {
    dataField: "firstName",
    text: "Frist name",
    sort: true
  },
  {
    dataField: "lastName",
    text: "Last name",
    sort: true
  },
  {
    dataField: "role",
    text: "Role",
    sort: true
  }
];


const User = (props) =>{

   return (
  <Container fluid className="p-0">
    <h1 className="h3 mb-3">Admin Management</h1>

    <Row>
      <Col>
        <Card>
          
          <CardBody>
            <BootstrapTable
              keyField="name"
              data={props.users}
              columns={tableColumns}
              striped
              hover
              bootstrap4
              bordered={false}
              pagination={paginationFactory({
              sizePerPage: 10,
              sizePerPageList: [5, 10, 25, 50]
              })}
            />
          </CardBody>
        </Card>
      </Col>
    </Row>
  </Container>
)};

export default connect(mapGlobalStateToProps,{getListUserAction})(User);
